/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(200) COLLATE utf8_spanish_ci NOT NULL,
  `password` varchar(250) COLLATE utf8_spanish_ci NOT NULL,
  `name` varchar(200) COLLATE utf8_spanish_ci DEFAULT NULL,
  `role` enum('admin','client') COLLATE utf8_spanish_ci DEFAULT NULL,
  `mc` varchar(10) COLLATE utf8_spanish_ci DEFAULT NULL,
  `key` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  `skey` varchar(255) COLLATE utf8_spanish_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `users_mail` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

