/*Table structure for table `vendors` */

DROP TABLE IF EXISTS `vendors`;

CREATE TABLE `vendors` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `vendor_date` date DEFAULT NULL,
  `order` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `provider` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `send_to` varchar(200) COLLATE utf8_spanish_ci DEFAULT NULL,
  `model` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `asin` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `sku` varchar(50) COLLATE utf8_spanish_ci DEFAULT NULL,
  `title` varchar(200) COLLATE utf8_spanish_ci DEFAULT NULL,
